Back>Incluído método de para excluir usuários / Front>Validação de email+correção barra de pesquisa+

A principal alteração introduzida por esse comit é a possibilidade de usuários que não tenham email @mdlz de utilizarem o sistema, caso um administrador ative seu cadastro.

Backend:
  Alterado método ownCreate, tornando usuários com email não-@mdlz automaticamente finalizados e inativos;

  Incluído método da api para exluir usuários.

Frontend:
  Validação de email em campos em que é inserido;

  Correção em tela de edição de usuário (admin);

  Incluído texto "Finalize seu cadastro;

  Incluído método de exclusão de usuários.
